import React,{useState} from 'react'

export default function Main() {
    const [search,setSearch]=useState("")
    const handleChange=()=>{
        setSearch()
    }
  return (
    <div>
      <h1>Main</h1>
      <input onChange={handleChange} type="text" />
      <h2>{search}</h2>
    </div>
  )
}
